html {
  height: 100%;
  background: radial-gradient(#fff 3px, transparent 5px, #fff 7px, transparent 9px, #fff 11px, transparent 13px, #fff 15px, transparent 17px, #fff 19px, transparent 21px, #fff 23px, transparent 25px, #fff 27px, transparent 29px, #fff 31px, transparent 33px);
  background-color: #111;
  color: white;
  background-size: 30px 30px;
}

body {
  background-color: #077FCC; /* fallback */
  background-color: rgba(34, 129, 204, 0.98);
  color: #333; /* fallback */
  color: rgba(0, 0, 0, 0.6);
  min-height: 100%;
  font-family: "Lucida Grande", "Lucida Sans Unicode", "Lucida Sans", Geneva, Verdana, sans-serif;
}

/* Home page */
.page-header {
  display: block;
  background-position: center center;
  background-image: url('/images/desk.jpg');
  background-repeat: no-repeat;
  background-size: cover;
  margin: 0 0 0 0;
  padding: 0 0 0 0;
  border-bottom: none;
}

/* .jumbotron */
.jumbotron.page-header {
  background-color: transparent; /* fallback */
  background-color: rgba(0, 0, 0, 0.5);
  border: none;
  margin-bottom: 0;
  padding-bottom: 0;
  min-height: 0;
}

.page-header + section {
  background-color: transparent;
  color: white;
}

.page-header + section .panel {
  color: rgba(0, 0, 0, 0.6);
}

/* headings */
h1, h2, h3, h4, h5, h6 {
  font-family: Georgia;
  font-family: "Lucida Grande", "Lucida Sans Unicode", "Lucida Sans", Geneva, Verdana, sans-serif;
  font-weight: normal;
  font-family: Futura, "Trebuchet MS", Arial, sans-serif;
  font-weight: normal;
}

.jumbotron.page-header h1 {
  font-size: 120px;
  margin-left: -5px;
  color: white;
}

section h6 {
  color: white;
}

h2 i {
  padding-right: 0.3em;
}

/* sectioning elements */
section, .section, .full {
  background-color: #ededed; /* fallback */
  background-color: rgba(255, 255, 255, 0.8);
}

article {
  padding-bottom: 1em;
}

article.panel {
  padding-bottom: 0;
}

/* footer */
footer {
  padding-bottom: 2em;
  margin-bottom: 0;
  text-transform: uppercase;
  font-size: 11px;
  font-weight: normal;
  font-family: Futura, "Trebuchet MS", Arial, sans-serif;
}

footer .list-inline > li {
  padding-left: 0;
  padding-right: 0;
  display: block;
  float: left;
}

footer .powered-by {
  text-indent: -119988px;
  overflow: hidden;
  background-image: url('/images/powered-by-3scale-light.png');
  background-repeat: no-repeat;
  background-position: bottom left;
  width: 109px;
  height: 19px;
  display: block;
  text-decoration: none;
  line-height: 19px;
  margin-top: -3px
}

footer .container {
  background-color: transparent; /* fallback */
  background-color: rgba(255, 255, 255, 0.05);
  border-bottom-right-radius: 3px;
  border-bottom-left-radius: 3px;
}

/* containers */
.page-header .container {
  padding-top: 2em;
  padding-bottom: 2em;
}

#main-content > .full > .container {
  min-height: 600px;
}

.container {
  padding-bottom: 4em;
  padding-top: 2em;
